  return (
    <div id="learnMore" className="section-container">
      <div className="section-content">
        <div className="section-text">
          <h2>
            <span>SECTION TWO</span>
          </h2>
          <p>
            Lorem ipsum dolor sit amet, consectetur adipiscing elit, sed do
